​ 24 октября прошло первенство КУМОП ЖКХ «Барановичское городское ЖКХ» ​ по шашкам и шахматам. Итоги первенства: 
ШАШКИ:

I место – аппарат управления,

II место – служба банного хозяйства и общественного питания;

III место – служба санитарной очистки и уборки;

ШАХМАТЫ:

I место – служба озеленения,

II место – служба банного хозяйства и общественного питания;

III место – разделили служба санитарной очистки и уборки и служба ритуальных услуг. ​
